import React from 'react';
import '../Styles/Head.scss';
import 'bootstrap/dist/css/bootstrap.css';

export default function Head() {

  return (
    <div className="Head">
      <div className="links col-sm">
        <a href="https://github.com/timbolaj">Github</a><span> </span>|<span> </span>
        <a href="https://linkedin.com/in/aaron-timbol-853383107/">LinkedIn</a>
      </div>

      <div className="Introduction-text">
        <div className="name">
          <p>Hi, I'm Aaron.</p>
        </div>

        <div className="description">
          <p>I'm a political science graduate turned software developer.</p>
          <p>I love languages, both human and machine.</p>
        </div>
      </div>
    </div>
  )
}
